import React, { useState, useEffect } from "react";
import "../styles/Contact.css";
import { FaInstagram, FaFacebookF, FaTwitter, FaPhoneAlt, FaEnvelope } from "react-icons/fa";

/* HERO IMAGES (4 specific images) */
const heroImages = [
  require("../assets/images/hero/hero3.jpg"),
  require("../assets/images/hero/hero4.jpg"),
  require("../assets/gallery/images/gallery3.jpg"),
  require("../assets/gallery/images/gallery4.jpg"),
];

function Contact() {
  const [currentSlide, setCurrentSlide] = useState(0);

  /* HERO SLIDESHOW */
  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentSlide((prev) => (prev + 1) % heroImages.length);
    }, 4000);
    return () => clearInterval(interval);
  }, []);

  const headingWords = [
    { text: "Get", color: "blue" },
    { text: "in", color: "white" },
    { text: "Touch", color: "blue" },
    { text: "with", color: "white" },
    { text: "RGM", color: "blue" },
    { text: "Family", color: "blue" },
  ];

  return (
    <div className="contact-page">

      {/* HERO SECTION */}
      <section
        className="contact-hero fade-in"
        style={{ backgroundImage: `url(${heroImages[currentSlide]})` }}
      >
        <div className="hero-overlay">
          <div className="arc-text">
            {headingWords.map((word, i) => (
              <span
                key={i}
                className={`arc-word slide-in`}
                style={{ color: word.color === "blue" ? "var(--blue)" : "#fff", "--i": i }}
              >
                {word.text}
              </span>
            ))}
          </div>
          <p className="hero-punchline">We are here to answer your questions and help you join the RGM family.</p>
        </div>
      </section>

      {/* CONTACT INFO CARDS */}
      <section className="contact-cards">
        <div className="card slide-in-left">
          <FaPhoneAlt className="icon" />
          <h3>Call Us</h3>
          <p><a href="tel:+1234567890">+1 234 567 890</a></p>
        </div>

        <div className="card slide-in-right">
          <FaEnvelope className="icon" />
          <h3>Email Us</h3>
          <p><a href="mailto:contact@rgmfamily.com">contact@rgmfamily.com</a></p>
        </div>

        <div className="card slide-in-left">
          <FaInstagram className="icon" />
          <h3>Instagram</h3>
          <p><a href="https://www.instagram.com/rgmfamily" target="_blank" rel="noreferrer">@rgmfamily</a></p>
        </div>

        <div className="card slide-in-right">
          <FaFacebookF className="icon" />
          <h3>Facebook</h3>
          <p><a href="https://www.facebook.com/rgmfamily" target="_blank" rel="noreferrer">@rgmfamily</a></p>
        </div>

        <div className="card slide-in-left">
          <FaTwitter className="icon" />
          <h3>Twitter</h3>
          <p><a href="https://twitter.com/rgmfamily" target="_blank" rel="noreferrer">@rgmfamily</a></p>
        </div>
      </section>

      {/* CONTACT FORM */}
      <section className="contact-form-section fade-in">
        <h2>Send Us a Message</h2>
        <form className="contact-form">
          <input type="text" placeholder="Your Name" required />
          <input type="email" placeholder="Your Email" required />
          <textarea placeholder="Your Message" rows="5" required></textarea>
          <button type="submit">Send Message</button>
        </form>
      </section>

    </div>
  );
}

export default Contact;
